<!DOCTYPE html>

<head>
    <meta charset="utf-8">
    <title>Home &amp; Recent</title>
    <script type="text/javascript">
        var require = {
            waitSeconds: 0,
            baseUrl: "../../"
        };
        var __REQUEST_INFO__ = {
            deps: [
                "builtin_apps/builtin_common",
                //"model/model",
                "prismux/prism.dlg",
                "prismux/prism.dlg.hub.new",
                "prismux/prism.dlg.button"
//                "prismux/prism.dlg.contextmenu"
            ],
            url: ["builtin_apps/home_menu/home_menu_new"]
        };
        window.fnGetPreReceivedMessages = (function(){
            var buffer = [];
            function messageHandler(messageEvent){
                buffer.push(messageEvent);
            }
            window.addEventListener("message",messageHandler);
            return function(){
                window.removeEventListener("message", messageHandler);
                return buffer;
            };
        }());
    </script>
